import React, { useEffect, useState } from "react";
import axios from "axios";

const Mid = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);
  const [movieData, setMovieData] = useState([]);
  const url_set = "YOUR_MOVIE_API_URL_HERE"; // Define the movie API URL

  useEffect(() => {
    const fetchMovieData = async () => {
      try {
        const res = await fetch(url_set);
        const data = await res.json();
        setData(data.results);
      } catch (error) {
        console.error("Error fetching movie data:", error);
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    fetchMovieData();
  }, [url_set]);

  useEffect(() => {
    const fetchData = async () => {
      const options = {
        method: 'GET',
        url: 'https://airbnb-data.p.rapidapi.com/WebAPIs/airbnb/category/v1',
        headers: {
          'X-RapidAPI-Key': 'c0ae563f37mshd4b90cc967d0f2bp1071f8jsnae849873a031',
          'X-RapidAPI-Host': 'airbnb-data.p.rapidapi.com'
        }
      };
      
      try {
        const response = await axios.request(options);
        setMovieData(response.data);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching Airbnb data:", error);
        setError(error);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>Error: {error.message}</p>;
  }

  return (
    <div>
      <h2>Inspiration for future getaways</h2>
      <div style={{ display: "flex", gap: "30px", marginBottom: "20px" }}>
        <div>Popular</div>
        <div>Art & Culture</div>
        <div>Outdoors</div>
        <div>Mountains</div>
        <div>Beach</div>
        <div>Unique Stays</div>
        <div>Categories</div>
        <div>Things To Do</div>
      </div>
      <div>
        {movieData.length === 0 ? (
          <p className="notfound">Not Found</p>
        ) : (
          movieData.map((res, pos) => (
            <div key={pos}>
              {/* Adjust rendering based on the structure of movieData */}
              <h3>{res.title}</h3>
              <p>{res.description}</p>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default Mid;
